// 通用返回顶部
$(function(){
    var $top=$(window).scrollTop();
    topFun($top);
    $(window).scroll(function(){
        var $top=$(window).scrollTop();
        topFun($top);
    })
    $("#back").click(function(){
        $("body,html").animate({scrollTop:0},300);
    })
    function topFun($t){
        if($t>100){
            $("#back").show();
        }else{
            $("#back").hide();
        }
    }
})

